import React, { Component } from 'react'
import { NavLink } from 'react-router-dom'

export default class MynavLink extends Component {
    render() {
        const { to } = this.props;
        return (
            <NavLink activeClassName='atguigu' className="list-group-item" to="/about">About</NavLink>
        )
    }
}
